window.bookSummaryJSON = "<p><b>She's fought death and won. But how can she fight her fears?</b></p> <p>Avry knows hardship and trouble. She fought the plague and survived. She took on King Tohon and defeated him. But now her heart-mate, Kerrick, is missing, and Avry fears he's gone forever. </p> <p>But there's a more immediate threat. The Skeleton King plots to claim the Fifteen Realms for his own. With armies in disarray and the dead not staying down, Avry's healing powers are needed now more than ever. </p> <p>Torn between love and loyalty, Avry must choose her path carefully. For the future of her world depends on her decision....</p>"; 
